        if P =:= 0 -> {undefined, R};
           true    -> <<L:8/unsigned, S:L/binary, X/binary>> = R,
                      {S, X}
        end).
-define(TABLE_PROP(P, R, L, T, X),
        if P =:= 0 -> {undefined, R};
